import React from 'react';
import './Card.css';


export default function Card ({min, max, name, img, onClose, id}) {
   return(
    <section className="wrapper">
     <div className="card" data-effect="zoom">
    <button  onClick={onClose} className="card__save " type="button">
      <i className="fa  fa-bookmark">X</i>
     </button>
     <figure  className="card__image">
      <img src="https://c1.staticflickr.com/4/3935/32253842574_d3d449ab86_c.jpg" alt="Short description"/>
    </figure>
    
    <div className="card__} header">
      <figure className="card__profile">
        <img src={"http://openweathermap.org/img/wn/"+img+"@2x.png"} alt="Short description"/>
      </figure>
    </div>
    <div className="card__body">
      <h3 className="card__name">{name}</h3>
      <p className="card__job">Min &nbsp;&nbsp; Max</p>
      <p className="card__bio">{min}°&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;{max}°</p>
    </div>
  </div>
  </section>
   ); 
};
